CREATE TABLE `sp_baidu_img` (
  `id` bigint NOT NULL COMMENT '主键id，雪花算法',
  `title` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '标题',
